import { NavLink } from 'react-router-dom';

const linkStyles = {
	display: 'inline-block',
	width: '50px',
	padding: '12px',
	margin: '0 6px 6px',
	background: '#f219ebc',
	textDecoration: 'none',
	color: '#f023047',
};

const NavBar = () => {
	return (
		<div>
			<NavLink
				to="/home"
				exact
				style={linkStyles}
				activeStyle={{
					background: 'darkblue',
				}}
			>
				Home
			</NavLink>
		</div>
	);
};

export default NavBar;
